import styled from 'styled-components';

export const Container = styled.div`
  flex: 1;
  height: 100%;
  width: 100%;
  background: #f3f3f3;
`;

export const HeaderDiv = styled.div`
    flex-direction: row;
    height: 18%;
`;

export const Logo = styled.img`
    margin-top: 3%;
    margin-left: 5%;
`;

export const UserNameLink = styled.a`
    font-size: 24px;
    margin-left: 55%;
    margin-top: 3%;
    position: absolute;
    color: #EE4131;
`;

export const BodyDiv = styled.div`
    background: #999;
    flex: 1;
    width: 100%;
    height: 82%;
`;
